(762, 'Akkumulyator batareyası', NULL, '4PZS460B24DY-AB', NULL, '/uploads/files/orders/images/order_fIPq_0.19044300 1552391058.PNG', 10, '\"Clark GEX- 16” markalı, 18 qaraj nömrəli, 2013-cü il buraxılışlı çəngəlli yükləyicinin akkumulyator batareyasının bankaları uzun müddətli işləmə nəticəsində iç hissəsi və mayesi yararsız vəziyyətə düşmüşdür. Qeyd edim ki, çəngəlli yükləyicinin akkumulyator batareyaları zavod istehsalı tərəfindən 2013-cü il tarixində quraşdırılaraq istismara verilmiş və bu vaxta qədər akkumulyator batareyaları dəyişilməmişdir. Bununla bağlı olaraq, “Clark GEX- 16” markalı, 18 qaraj nömrəli çəngəlli yükləyici üçün akkumulyator batareyasının yenisi ilə əvəz olunmasına zərurət yaratmışdır.', 0, NULL, '2019-03-12', '2019-03-29', 18, 2, 1, 297, NULL, '/uploads/files/orders/defects/defect_7ArW.pdf', '24.00', NULL, NULL, 1, '2019-03-12 17:48:32', 72, NULL, NULL, NULL, NULL, 0, NULL, NULL, 2, NULL, NULL, NULL, NULL),
(763, 'Ön diferensial top (yataq, kipliklərlə birlikdə)', NULL, NULL, NULL, '/uploads/files/orders/images/order_s5TO_0.79107300 1552391318.JPG', 13, '“Fiat Doblo” markalı, 181 qaraj nömrəli avtomobilin hərəkət etməsində, sürətlər qutusunda nasazlıq əmələ gəlmişdir. Avtomobilə baxış keçirilərək müəyyən edilmişdir ki, avtomobilin ötürücü oxun diferensial topunun (sotalit) dişləri, diferensial topun yatağı yeyilmiş və kiplikləri keyfiyyətini itirmişdir. Beləliklə həmin ehtiyat hissələrinin təmiri mümkün olmadığı üçün, onların yenisi ilə əvəz edilməsinə zərurət yaratmışdır.', 0, NULL, '2019-03-12', '2019-04-25', 18, 2, 1, 149, NULL, '/uploads/files/orders/defects/defect_ExQF.pdf', '1.00', 31, '2019-04-25', 1, '2019-03-12 17:48:17', 72, NULL, NULL, NULL, NULL, 0, NULL, NULL, 20, NULL, NULL, NULL, NULL),
