(1234, '185/75R16', NULL, NULL, NULL, '/uploads/files/orders/images/order_Dehl_0.51726600 1554790498.JPG', 10, 'Avtomobilinin təkərləri işləmə müddəti nəticəsində protektor naxışları yeyilmiş, naxışlar arasında çatlar əmələ gəlmiş və deformasiyaya uğramışdır. Belə ki, avtomobilin təkərlərinin sonuncu dəyişmə tarixi 31.08.2017 - ci il olmaqla bu günədək qəth etdiyi məsafə 60966 km olmuşdur. Avtomobilin şinlərinin deformasiyaya uğraması, protektor naxışlarının işləmə müddəti nəticəsində yeyilməsi, şinlərin üzərində olan çatlar və qopmuş hissələr avtomobilin işləməsində çətinliklər yaradır.', 0, NULL, '2019-04-09', '2019-04-24', 18, 2, 10, 33, NULL, '/uploads/files/orders/defects/defect_X6V9.pdf', '4.00', 32, '2019-04-24', 1, '2019-04-09 12:11:14', 72, NULL, NULL, 77, NULL, 0, NULL, NULL, 21, NULL, NULL, NULL, NULL),
