(1297, 'MW ADAPTER 12 V  400-480 W (külleri olan)', 'Terminal 1, Təmir və texniki qulluq xidməti-Elektrik avadanlığının texniki təminatı sahəsi', 'null', NULL, '/uploads/files/orders/images/order_XtiN_0.55196200 1554987796.jpg', 10, 'Terminal 1-də yüksək tavanda 660 ədəd üçbucaq led panellər quraşdırılıb. Hər bir panelin üstündə 1 ədəd 12 v  350 - 360 vattlıq,  MW firmasının adapteri var. Terminal 1- də axrıncı 10 ay əzrində  20 –yə qədər adapter sıradan çıxıb və yenisi ilə əvəz edilib. Təmirdən gələn led panellərin led işıqları fərqli olduğuna görə dahada cox enerji tələb edir,buda adapterlərin çox qızmasına və nəticədə sıradan çıxmasına gətirir. Sifariş TTQX - nin elektrik avadanlığının texniki təminatı sahəsinin rəisi Xəlilov Yaşar tərəfindən verilmişdir.', 0, NULL, '2019-04-11', '2019-04-17', 18, 2, 4, NULL, NULL, NULL, '100.00', 29, NULL, 1, '2019-04-12 15:21:55', 72, NULL, NULL, NULL, NULL, 0, NULL, NULL, 2, NULL, NULL, NULL, NULL),
